description:
Pack your bags for a trip through the skies in Airport Mania! Travel through 8 amusing airports while you land a variety of planes, purchase upgrades, and avoid delays. Stay on your toes as some planes carry precious cargo and will need to land in a hurry, while others might need a trip to the repair shop.

